import React, { StrictMode } from "react";
import ReactDOM from "react-dom/client";

const name = 'hossein'
const age = 21
const city = 'shiraz'

function mybio(){
  return(
    <div>
      <h1>hello {name},
        age : {age},
        city : {city}
      </h1>
    </div>
  )
}

ReactDOM.createRoot(document.getElementById("root")).render(
    <StrictMode>
      <div>{mybio()}</div>
    </StrictMode>
  );
